        "created": 1409428206000, 
        "description": "<p>For our September Meetup, we're once again going to have Lightning Talks!\u00a0Eight members of our Data Science community will each be speaking for just eight minutes each. These talks will include research, lessons learned in practice, and interesting tools, all in bite-sized packages. We guarantee a great time!</p> <p><br/>The event will be co-located with the <b>Predictive Analytics World - Government</b> conference, running the 15th through the 18th, which is why the new venue and slightly-delayed time. \u00a0You do <i>not</i> have to attend the conference to attend this Meetup event -- everyone is welcome! However, if you do want to attend the conference, we have a discount code for you. <a href=\"http://www.predictiveanalyticsworld.com/gov/2014/\">Use DATADC for 15% of registration to the\u00a0largest and only vendor-neutral analytics conference for government</a>!\u00a0</p> <p><b>Note</b>: Because of hotel catering requirements, we won't be serving empenadas as usual. There may be <i>hors d'</i><i>oeuvres</i>, or something else\u00a0-- we'll let you know soon.\u00a0</p> <p><b>Agenda:</b></p> <p>\u2022\u00a07:00pm -- Networking and Refreshments <i>TBA</i></p> <p>\u2022\u00a07:30pm -- Introduction</p> <p>\u2022\u00a07:45pm -- Presentations!</p> <p>\u2022 9:00pm -- Data Drinks (<i>TBA</i>)</p> <p><b>Speakers:</b></p> <p>\u2022\u00a0<a href=\"http://stephenbach.net/\">Stephen Bach</a>, University of Maryland, <i>Statistical Relational Models for Social Good</i></p> <p>\u2022\u00a0Kevin T. Smith, <a href=\"http://www.novetta.com/\">Novetta</a>,\u00a0<i>Security and Privacy of Big Data in a Dangerous World</i></p> <p><br/>\u2022\u00a0<a href=\"https://twitter.com/nicktabbal\">Nick Tabbal</a>,\u00a0Bulletin Intelligence,\u00a0<i>Leveraging technology and human judgement to generate daily insights from Open Source Intelligence</i></p> <p><br/>\u2022\u00a0<a href=\"https://www.linkedin.com/profile/view?id=130190052\">Margaret Ward</a>, United States Coast Guard,\u00a0<i>Creating Healthy Workforce Flow</i></p> <p>\u2022 <a href=\"https://twitter.com/castrotech\">Daniel Castro</a>, Center for Data Innovation, <i>Data is Law (and Law is Data)</i></p> <p><br/>\u2022 <a href=\"https://www.linkedin.com/profile/view?id=221277\">Marck Vaisman</a>, Data Community DC, <i>From Hierarchical to Graph Data</i></p> <p><br/><i>\u2022 more to come...!</i></p> <p><b>Sponsors:</b></p> <p>This event is sponsored by <a href=\"http://www.predictiveanalyticsworld.com/gov/2014/\">Predictive Analytics World - Government</a>,\u00a0<a href=\"http://www.cloudera.com/\">Cloudera</a>,\u00a0<a href=\"http://bit.ly/12YljkP\">Statistics.com</a>,\u00a0<a href=\"https://corporate.livingsocial.com/browsealljobs/?deep_link=/jobs/olpfYfwH\">LivingSocial</a>,\u00a0<a href=\"http://novetta.com/\">Novetta Solutions</a>,\u00a0<a href=\"http://datamininglab.com/\">Elder Research</a>, and\u00a0<a href=\"http://www.five9group.com/\">Five 9 Group</a>. Would you like to sponsor too? Please get in touch!\u00a0</p>", 
